import Input from '../form/input'
import ButtonForm from '../form/buttonForm'

function UpdateForm(props){
    return (
        <div>
            <p>{props.formName}</p>
            <form onSubmit={props.handleSubmit}>
                 {props.children}
                 <ButtonForm />
            </form>
        </div>
    )
}

export default UpdateForm
